import streamlit as st
import pandas as pd

df = pd.read_csv('./data/dev.csv')
df = df.drop( [ '법정동코드','자치구코드' ,'지번구분' ,'권리구분','취소일'] , axis=1)
df = df.fillna('NoData')
df['계약일'] = pd.to_datetime(df['계약일'].astype(str))
df['접수연도'] = df['접수연도'].astype(str)
print(df['계약일'])


menu = ['Home','실거래가','차트/그래프 분석']


def main() :
    
    choice = st.sidebar.selectbox('Menu', menu)
    if choice == menu[0] :
        st.header('2023년 서울특별시 부동산 실거래 동향 분석')
        st.image('data:image/jpeg;base64,', width=800)
    
    if st.checkbox('보기') :
        st.dataframe(df)
       
        st.text('출처 : https://data.seoul.go.kr/dataList/OA-21275/S/1/datasetView.do')

if __name__ == '__main__' :
    main()

